import React from 'react'
import axios from 'axios'


class CompanyGraph extends React.Component{
    constructor(){
        super()
        this.state = {
          partners:[]
        }
      }
    render(){
        const api = axios.create({
            baseURL: 'http://localhost:9200/proto/_search?q=id:'.concat(this.props.currentCompany.Partenaire__002)
          })
          api.get('')
            .then(async(res) => {
              console.log(this.props.currentCompany.nature)
              this.setState({others:res.data.hits.hits})
        });
        return(
            <div>{this.state.partners.id}</div>
        )
    }
}

export default CompanyGraph
